import React from "react";
import Alumno from "./Components/Alumno";
import Application from "./Components/Application";
import UserProvider from "./providers/UserProvider";

function App() {
  return (
    <UserProvider>
      <Application />
      
    </UserProvider>

  );
}

export default App;
